import React, { useState, useEffect } from "react";

function App() {
  const [games, setGames] = useState([]);
  const [selectedGame, setSelectedGame] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [sportKey, setSportKey] = useState("basketball_nba");

  useEffect(() => {
    fetch(`http://localhost:8000/games/${sportKey}`)
      .then((res) => res.json())
      .then((data) => setGames(data))
      .catch((err) => console.error("Failed to fetch games", err));
  }, [sportKey]);

  const handlePredict = () => {
    fetch("http://localhost:8000/predict", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        team_id_home: selectedGame.team_id_1,
        pts_home: selectedGame.odds?.[selectedGame.team_1] ?? 100,
        team_id_away: selectedGame.team_id_2,
        pts_away: selectedGame.odds?.[selectedGame.team_2] ?? 100,
      }),
    })
      .then((res) => res.json())
      .then((data) => setPrediction(data));
  };
  fetch("http://localhost:8000/analyze-bet/", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({
      prompt: "Team A is 9-1 at home, Team B is missing 2 starters...",
    }),
  })
    .then((res) => res.json())
    .then((data) => console.log(data.analysis));

  return (
    <div style={{ padding: "2rem" }}>
      <h1>AI Sports Prediction</h1>

      {/* ðŸ”½ Dropdown to select sport */}
      <label>Select a sport: </label>
      <select onChange={(e) => setSportKey(e.target.value)} value={sportKey}>
        <option value="basketball_nba">NBA</option>
        <option value="americanfootball_nfl">NFL</option>
        <option value="baseball_mlb">MLB</option>
        <option value="soccer_epl">Soccer (EPL)</option>
      </select>

      {games.map((game, idx) => (
        <div key={idx} style={{ marginBottom: "1rem" }}>
          <p>
            <strong>{game.team_1}</strong> vs <strong>{game.team_2}</strong> (
            {new Date(game.date).toLocaleString()})
          </p>

          {/* ðŸ’° Moneyline Odds */}
          {game.odds && (
            <p>
              <strong>Moneyline:</strong> {game.team_1} -{" "}
              {game.odds[game.team_1]} | {game.team_2} -{" "}
              {game.odds[game.team_2]}
            </p>
          )}

          {/* ðŸ“ˆ Spread Odds */}
          {game.spreads && (
            <p>
              <strong>Spread:</strong> {game.team_1} -{" "}
              {game.spreads[game.team_1]?.point ?? "N/A"} (
              {game.spreads[game.team_1]?.price ?? "N/A"}) | {game.team_2} -{" "}
              {game.spreads[game.team_2]?.point ?? "N/A"} (
              {game.spreads[game.team_2]?.price ?? "N/A"})
            </p>
          )}

          <button onClick={() => setSelectedGame(game)}>Select</button>
        </div>
      ))}

      {/* ðŸ”® Prediction */}
      {selectedGame && (
        <div style={{ marginTop: "1rem" }}>
          <h2>
            Selected: {selectedGame.team_1} vs {selectedGame.team_2}
          </h2>
          <button onClick={handlePredict}>Predict Winner</button>
        </div>
      )}

      {prediction && (
        <div style={{ marginTop: "1rem" }}>
          <h3>Prediction: {prediction.prediction}</h3>
          <p>Confidence: {(prediction.confidence * 100).toFixed(1)}%</p>
        </div>
      )}
    </div>
  );
}

export default App;
